import "../../css/command.css";

const Resume = () => {
  return (
    <div className="modal">
      <div className="modalContent">
        <iframe
          src="../images/resume.pdf"
          //   style="width:600px; height:500px;"
          frameborder="0"
        ></iframe>
      </div>
    </div>
  );
};

export default Resume;
